import React from 'react';
import ReactDOM from 'react-dom';
import './style.scss';

import Header from './components/Header.js';
import Camera from './components/Camera.js';


class App extends React.Component {
  render() {
    return (
      <div>
        <Header />
        <main>
          <div class="box modules">
            <Module title="Hey"/>
            <Module title="Test"/>
            <Module title="Hello"/>
          </div>
          <div><Camera /></div>
          <div class="box modules">
            <Module title="Hey"/>
            <Module title="Test"/>
            <Module title="Hello"/>
          </div>
        </main>
        <div class="terminals">
          <Terminal />
          <Terminal />
        </div>
      </div>
    );
  }
}

// ========================================

ReactDOM.render(
  <App />,
  document.getElementById('root')
);
